import React from "react";
import "./VirtualSessions.css";

const VirtualSessions = () => {
  return (
    <div className="virtual-sessions-container">
      <h1>Virtual Sessions</h1>
      <p>Explore virtual counseling sessions for mental health support from the comfort of your home.</p>
      <div className="sessions-list">
        <div className="session-card">
          <h3>Anxiety Management Session</h3>
          <p>Join Dr. Jane Smith for a virtual session on managing anxiety effectively.</p>
          <button className="book-button">Book Now</button>
        </div>
        <div className="session-card">
          <h3>Stress Reduction Techniques</h3>
          <p>Learn stress reduction techniques with Dr. Emily Davis.</p>
          <button className="book-button">Book Now</button>
        </div>
        <div className="session-card">
          <h3>Overcoming Depression</h3>
          <p>Dr. Robert Johnson will guide you through strategies to overcome depression.</p>
          <button className="book-button">Book Now</button>
        </div>
      </div>
    </div>
  );
};

export default VirtualSessions;
